import React, { useEffect, useState } from 'react'

function SelectResults() {
    const [year, setYear] = useState('')
    const [branch, setBranch] = useState('')
    const [heldin, setHeldin] = useState('')

    useEffect(()=>{
        console.log(year, branch, heldin)
    })

  return (
    <div>
        <div>
            <h1>Enter Year</h1>
            <input type='text' onChange={(e) => setYear(e.target.value)}/>
        </div>
        <div>
            <h1>Enter Branch</h1>
            <input type='text' onChange={(e) => setBranch(e.target.value)}/>
        </div>
        <div>
            <h1>Enter Heldin</h1>
            <input type='text' onChange={(e) => setHeldin(e.target.value)}/>
        </div>
    </div>
  )
}

export default SelectResults
